css:
@-moz-document url-prefix("http://funnyjunk.com/"), url-prefix("http://www.funnyjunk.com/") {
#commentsList {
background: url('http://www.minecraft.net/images/bg_main.png') !important;
}
}

@-moz-document url-prefix("http://funnyjunk.com/"), url-prefix("http://www.funnyjunk.com/") {
#topUserbar {
height: 40px;
background: 
#303030 url('http://www.minecraft.net/images/bg_top.png') bottom repeat-x;
position: fixed;
width: 97.5%;
top: 0;
z-index: 10;
min-width: 960px;
}
}

@-moz-document url-prefix("http://funnyjunk.com/"), url-prefix("http://www-funnyjunk.com/") {
body {
margin: 0 15px;
background: 
#0F0F0F url('http://www.minecraft.net/images/bg_main.png');
overflow: auto;
font-family: arial,verdana,sans-serif;
font-size: 12px;
color: 
white;
}
}

@-moz-document url-prefix("http://funnyjunk.com/"), url-prefix("http://www.funnyjunk.com/") {
#content {
margin-top: 9px;
background: 
#242424 url('http://www.minecraft.net/images/bg_main.png');
border: 1px solid 
#2A2A2A;
min-height: 800px;
}
}

@-moz-document url-prefix("http://funnyjunk.com/"), url-prefix("http://www.funnyjunk.com/") {
#contentRight .main {
margin: 2px 10px 8px 10px;
border: 1px solid 
background-repeat: 
url('http://www.minecraft.net/images/bg_main.png')
#191919;
}
}

@-moz-document url-prefix("http://funnyjunk.com/"), url-prefix("http://www.funnyjunk.com/") {
#contentRight .title {
min-height: 30px;
background: 
#1F1F1F
url('http://www.minecraft.net/images/bg_top.png');
}
}

@-moz-document url-prefix("http://funnyjunk.com/"), url-prefix("http://www.funnyjunk.com/") {
#contentLeft ul.menu1 li {
height: auto;
background: 
url('http://www.minecraft.net/images/bg_top.png');
margin-bottom: 2px;
overflow: hidden;
white-space: normal;
}
}

#contentRight .inner {
background: 
#191919
url('http://www.minecraft.net/images/bg_main.png');
padding: 10px;
}

#contentRight .f {
min-height: 15px;
padding: 5px 20px;
background: none
color: 
white;
}
